    /// <summary>
    /// Data downloader class for pulling data from Data Provider
    /// </summary>
    public class DukascopyDataDownloader : IDataDownloader, IDisposable
    {
        /// <inheritdoc cref="DukascopyDataProvider"/>
        private readonly DukascopyDataProvider _myCustomDataProvider;

        /// <summary>
        /// Initializes a new instance of the <see cref="DukascopyDataDownloader"/>
        /// </summary>
        public DukascopyDataDownloader()
        {
            _myCustomDataProvider = new DukascopyDataProvider();
        }

        /// <summary>
        /// Get historical data enumerable for a single symbol, type and resolution given this start and end time (in UTC).
        /// </summary>
        /// <param name="dataDownloaderGetParameters">Parameters for the historical data request</param>
        /// <returns>Enumerable of base data for this symbol</returns>
        /// <exception cref="NotImplementedException"></exception>
        public IEnumerable<BaseData> Get(DataDownloaderGetParameters dataDownloaderGetParameters)
        {
            var error = DukascopyRaw.GetNextQuote(dataDownloaderGetParameters.StartUtc,
                dataDownloaderGetParameters.Symbol.Value,
                out DateTime time,
                out uint ask,
                out uint bid,
                out float askVolume,
                out float bidVolume,
                out bool isFirstTickOfHour,
                out bool isLastTickOfHour);

            if ("" != error)
                DukascopyRaw.FindFirst(dataDownloaderGetParameters.Symbol.Value, out time);

            // Define a list to store QuoteBar instances
            var quoteBars = new List<BaseData>();

            // Populate the list with QuoteBars in a loop
            for (DateTime dt = time; dt < dataDownloaderGetParameters.EndUtc;)
            {
                error = DukascopyRaw.GetNextQuote(dt, dataDownloaderGetParameters.Symbol.Value,
                    out time,
                    out ask,
                    out bid,
                    out askVolume,
                    out bidVolume,
                    out isFirstTickOfHour,
                    out isLastTickOfHour);

                var bidBar = new Bar(bid, bid, bid, bid);
                var askBar = new Bar(ask, ask, ask, ask);

                // Create a QuoteBar instance
                var quoteBar = new QuoteBar(
                    time,
                    dataDownloaderGetParameters.Symbol,
                    bidBar,
                    (decimal)bidVolume,
                    askBar,
                    (decimal)askVolume
                );

                // Add to the list
                quoteBars.Add(quoteBar);

                if (isLastTickOfHour)
                    dt += TimeSpan.FromHours(1);
            }

            return quoteBars;
        }

        /// <summary>
        /// Performs application-defined tasks associated with freeing, releasing, or resetting unmanaged resources.
        /// </summary>
        public void Dispose()
        {
            _myCustomDataProvider?.DisposeSafely();
        }

